import logo from './logo.png';
import './App.css';
import Login from "./login";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div>
        <p class="red">관리자 </p>
        <p>화면</p>
        </div>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <Login></Login>
      </header>
    </div>
  );
}

export default App;
